import React, {useEffect, useState} from 'react';


function Blogs () {
    const [blogs, setBlogs] = useState([]);

    useEffect(()=>{
        fetch('http://localhost:4000/articles')
        .then((response) => response.json())
        .then((data) => {
            setBlogs(data);
        })
    }, []);


    console.log("******blogs****************");
    console.log(blogs);
    console.log("******blogs****************");
    return(
       blogs.map
    )
}

export default Blogs;
